// import Typography from '@material-ui/core/Typography';
import Slider from '@material-ui/core/Slider';
import './doubleSlider.css';
import { useState } from 'react';
import * as tf from '@tensorflow/tfjs';
import { Dropbox } from 'dropbox';

let valuetext = value => `${value}`;
let model;
function DoubleSlider() {  
    const [sliderVState, setSliderVState] = useState(1);
    const [sliderHState, setSliderHState] = useState(1);
    let fileName = `/man-images/${sliderHState}_${sliderVState}.png`;
    const url = {
      modelLink: 'https://www.dropbox.com/s/mhioc6hkavycmm8/model.json',
      metadata: 'https://storage.googleapis.com/tfjs-models/tfjs/sentiment_cnn_v1/metadata.json'
    };

    const accessToken = 'sl.AryZANByM9i-_fzO3wKs868fjp-HQ83FCSLbBhpg39lRA8ttaL9IEV5No-zHbkUqw5ggND7j4bmWLbYk-s7l6kSNdiONl0xjlD4UakXbh9iHfA0q2PSNgvVaMHpLTOKbJ0geWCg';

    const dbx = new Dropbox({  
      accessToken,  
      fetch  
    });
    async function loadModel(url) {
      try {
        model = await tf.loadLayersModel(url.modelLink);
        console.log(model);
      } catch (err) {
        console.log(err);
      }
    }
    loadModel(url);
    console.log(model);
    function handleVChange(e){
      setSliderVState(e.target.value);
    } 
    function handleHChange(e){
      console.log(e);
      setSliderHState(e.target.value);
    }

    return (
    <div className="large-box">  
      <div className="image-box">
        <img src={process.env.PUBLIC_URL + fileName}></img>
      </div>
      <div className="vSlider">
        <Slider
          orientation="vertical"
          getAriaValueText={valuetext}
          defaultValue={1}
          aria-labelledby="discrete-slider-small-steps"
          min={0}
          max={100}
          marks
          valueLabelDisplay="auto"
          onChange={handleVChange}
        />
      </div>
      <div className="hSlider">
        <Slider
          defaultValue={1}
          getAriaValueText={valuetext}
          aria-labelledby="discrete-slider-small-steps"
          step={1}
          marks
          min={0}
          max={100}
          valueLabelDisplay="auto"
          onChange={handleHChange}
        />
      </div>
    </div>
    );
  }
  export default DoubleSlider;
